DROP TABLE IF EXISTS `wms_serial_number`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `wms_serial_number` (
  `sn_id` bigint NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `sn_code` varchar(100) NOT NULL COMMENT 'SN码/序列号',
  `item_id` bigint DEFAULT NULL COMMENT '物品ID',
  `item_no` varchar(50) DEFAULT NULL COMMENT '物品编号',
  `item_name` varchar(255) DEFAULT NULL COMMENT '物品名称',
  `spec` varchar(255) DEFAULT NULL COMMENT '规格型号',
  `bind_status` char(1) DEFAULT '0' COMMENT '绑定状态 0-未绑定 1-已绑定',
  `inbound_time` datetime DEFAULT NULL COMMENT '入库时间',
  `receipt_order_no` varchar(50) DEFAULT NULL COMMENT '入库单号',
  `shipment_order_no` varchar(50) DEFAULT NULL COMMENT '出库单号',
  `warehouse_id` bigint DEFAULT NULL COMMENT '当前位置（仓库ID）',
  `rack_no` varchar(50) DEFAULT NULL COMMENT '当前位置（货架编号）',
  `create_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `create_by` varchar(64) DEFAULT '' COMMENT '创建者',
  `update_time` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  `update_by` varchar(64) DEFAULT '' COMMENT '更新者',
  `remark` varchar(500) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`sn_id`),
  UNIQUE KEY `uk_sn_code` (`sn_code`),
  KEY `idx_item_id` (`item_id`),
  KEY `idx_bind_status` (`bind_status`),
  KEY `idx_receipt_order_no` (`receipt_order_no`),
  KEY `idx_shipment_order_no` (`shipment_order_no`)
) ENGINE=InnoDB AUTO_INCREMENT=204 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='序列号/SN码表';
/*!40101 SET character_set_client = @saved_cs_client */;

